import styled from "styled-components";

export const ImgProduto = styled.img `
    width:300px;
    height:300px;
    border-radius:40px;

`;

export const Container = styled.div`

    display:flex;
    width:100vw;
    height:80vh;
    background-color:white;
    align-items:center;


    h1{
        margin-bottom:25px;
    }

`;
